package testservice

import (
	"context"
	"fmt"
	"time"
	"vvnbd/internal/pkg/domain"

	influxdb2 "github.com/influxdata/influxdb-client-go/v2"
)

var (
	testHelloWorld = domain.HelloWorld{
		Username: "JohnDoe",
		FullName: "John Doe",
		Login:    "johndoe",
		Icon:     "",
	}

	testPoint = influxdb2.NewPointWithMeasurement("stat").
			AddTag("unit", "temperature").
			AddField("avg", 23.2).
			AddField("max", 45.0).
			SetTime(time.Now())
)

func (s *Service) SetHelloWorld(ctx context.Context) error {
	err := s.mongoRepo.InsertHelloWorld(ctx, testHelloWorld)
	if err != nil {
		return fmt.Errorf("unable to insert hello world Err: %w", err)
	}

	err = s.influxRepo.SetPoint(ctx, testPoint)
	if err != nil {
		return fmt.Errorf("unable to insert test point Err: %w", err)
	}

	return nil
}
